import React from 'react'

const Accordiom = ({data}) => {
  return (
    <>
    {data.length?(
      data.map(item=>{
        return  <div className='mt-4' key={data.id}>
        <details>
          <summary>
              {item.questions}
          </summary>
          <div>
              <p>{item.answers}</p>
              <button className='buttn buttn2 p-1'>مسح </button>
          </div>
        </details>
      </div>
      })
    ):(<h2 className='mt-3'>لا يوجد اسئلة الان</h2>)}{

    data.length?(
      <button className='buttn buttna mt-2'>مسح الكل</button>

    ):(null)}
    </>
  )
}

export default Accordiom
